import React from "react";

const userInput = () => {

    const inputStyle = {
        padding: "1rem .5rem",
        borderRadius: "5px",
        width: "20%",
        border: "1px solid #eee",
        boxShadow: "none"
    };

    return (
        <div>
            <input type="text" placeholder="enter a new username..." style={inputStyle} />
            <button>Change!</button>
        </div>
    );
};

export default userInput;
